    increment(){
        this.state.conut = this.state.count +1;
        cpnsole.log("count: "+this.state.conut);
    }
    
    render() {
        return (
            <div>
                <div>Count : {this.state.conut}</div>
                <button onClick={() => this.increment()}>Increment</button>
            </div>
        )
    }
}

